import React from 'react';
import { Link, NavLink } from 'react-router-dom';
import '../styles/Dashboard.css';

const Dashboard = () => {
  return (
    <div className="dashboard-container">
      {/* Sidebar inside dashboard */}
      <aside className="dashboard-sidebar">
        <h2>Admin Panel</h2>
        <nav>
          <NavLink to="/admin" end className={({ isActive }) => isActive ? 'active' : ''}>
            Dashboard
          </NavLink>
          <NavLink to="/admin/products" className={({ isActive }) => isActive ? 'active' : ''}>
            Products
          </NavLink>
          <NavLink to="/admin/orders" className={({ isActive }) => isActive ? 'active' : ''}>
            Orders
          </NavLink>
          <NavLink to="/admin/messages" className={({ isActive }) => isActive ? 'active' : ''}>
            Messages
          </NavLink>
        </nav>
      </aside>

      {/* Main content area */}
      <main className="dashboard-main">
        <h1>Dashboard</h1>
        <div className="dashboard-links">
          <Link to="/admin/products" className="dashboard-box">Manage Products</Link>
          <Link to="/admin/orders" className="dashboard-box">Manage Orders</Link>
          <Link to="/admin/messages" className="dashboard-box">Customer Messages</Link>
        </div>
      </main>
    </div>
  );
};

export default Dashboard;
